import React,{useEffect, useRef, useState} from 'react';

export function Chart(setSymbols:any){
    let cnv:any = useRef(null);
    useEffect(()=>{
        let ctx = cnv.current.getContext('2d');
        ctx.beginPath();
        ctx.rect(40,40,200,200);
        ctx.fillStyle = 'blue';
        ctx.fill();
    },[]);
    return (
        <canvas ref={cnv} style={{marginLeft:'5%',marginTop:'5%',width:'80%',height:'80%',backgroundColor:'white'}}>
        </canvas>
    );   
}
